import {FaLinkedin, } from "react-icons/fa";
import "./Home.css";


function Home() {
  return (
    <div className="home">
      <div className="home--header">
        <PedImg />
        <h2 className="home--top">Hi there, my name is Pedraam! Thanks for stopping by. Take a look inside to learn a bit about me and see some of the things I've done within CS.</h2>
      </div>
      <div className="buttons">
        <Button buttonStyle="btn--aboutme">About Me</Button>
        <Button buttonStyle="btn--projects">Projects</Button>
        <Button buttonStyle="btn--resume">Resume</Button>
      </div>
    </div>
  );
}

export default Home;
